  "translationLines": [
    {
      "lineNumber": 43951,
      "originalJapaneseLine": "「ぐっ、ではここを守っても仕方がない……！",
      "translatedEnglishLine": "\"Ugh, then there's no point in defending this place...!\""
    },
    {
      "lineNumber": 43952,
      "originalJapaneseLine": "　撤退、撤退だ！」",
      "translatedEnglishLine": "Retreat, retreat!\""
    },
    {
      "lineNumber": 43953,
      "originalJapaneseLine": "「ひけ、退けーーーーーー！」",
      "translatedEnglishLine": "\"Fall back, retreatーーーーーー!\""
    },
    {
      "lineNumber": 43954,
      "originalJapaneseLine": "「……！　間に合った、かっ……！」",
      "translatedEnglishLine": "\"...! Did we make it in time...!?\""
    },
    {
      "lineNumber": 43955,
      "originalJapaneseLine": "鮮血が止まらない肩口を押さえながら、",
      "translatedEnglishLine": "Pressing a shoulder where fresh blood wouldn’t stop flowing,"
    },
    {
      "lineNumber": 43956,
      "originalJapaneseLine": "サイアスは崩れかかる膝をどうにか堪えた。",
      "translatedEnglishLine": "Saias somehow held his collapsing knees."
    },
    {
      "lineNumber": 43957,
      "originalJapaneseLine": "「追撃は程々で良いわ！",
      "translatedEnglishLine": "\"A moderate pursuit is enough!"
    },
    {
      "lineNumber": 43958,
      "originalJapaneseLine": "　深追いはしないように……」",
      "translatedEnglishLine": "Don’t chase too far...\""
    },
    {
      "lineNumber": 43959,
      "originalJapaneseLine": "「逃げたぞ、叩けぇ！",
      "translatedEnglishLine": "\"They’re fleeing, strike them!"
    },
    {
      "lineNumber": 43960,
      "originalJapaneseLine": "　今日はモンスターどもの肉でフルコースだ！」",
      "translatedEnglishLine": "Today it's a full course of monster meat!\""
    },
    {
      "lineNumber": 43961,
      "originalJapaneseLine": "「イヤッホォォォォォ！！」",
      "translatedEnglishLine": "\"Yaaaahoooooo!!\""
    },
    {
      "lineNumber": 43962,
      "originalJapaneseLine": "「ならば内部の掃除は我の仕事だな。",
      "translatedEnglishLine": "\"Then the cleanup inside is my job."
    },
    {
      "lineNumber": 43963,
      "originalJapaneseLine": "　残っている連中を叩き出す！」",
      "translatedEnglishLine": "I’ll drive out those still remaining!\""
    },
    {
      "lineNumber": 43964,
      "originalJapaneseLine": "「ヒャッハーーーーーー！　略奪だーーー！",
      "translatedEnglishLine": "\"Hyahhaーーーーーー! Lootingーーー!"
    },
    {
      "lineNumber": 43965,
      "originalJapaneseLine": "　根こそぎイクぞゴルルルルァァァ！」",
      "translatedEnglishLine": "I’m going to take everything, gorurururuaaah!\""
    },
    {
      "lineNumber": 43966,
      "originalJapaneseLine": "「……………………」",
      "translatedEnglishLine": "\"........................\""
    },
    {
      "lineNumber": 43967,
      "originalJapaneseLine": "「……元気な連中だな、どうも。",
      "translatedEnglishLine": "\"...They’re lively fellows, aren’t they."
    },
    {
      "lineNumber": 43968,
      "originalJapaneseLine": "　怪我してないか、ウスピラ」",
      "translatedEnglishLine": "Aren’t you hurt, Uspila?\""
    },
    {
      "lineNumber": 43969,
      "originalJapaneseLine": "「サイアス。そっちこそ……その、無事？」",
      "translatedEnglishLine": "\"Saias. You too... um, are you alright?\""
    },
    {
      "lineNumber": 43970,
      "originalJapaneseLine": "「ああ。問題はないよ」",
      "translatedEnglishLine": "\"Yeah. No problem.\""
    },
    {
      "lineNumber": 43971,
      "originalJapaneseLine": "「……嘘つき。ボロボロじゃない」",
      "translatedEnglishLine": "\"...Liar. You’re all torn up.\""
    },
    {
      "lineNumber": 43972,
      "originalJapaneseLine": "「本当さ。どうにか、致命傷は避けた」",
      "translatedEnglishLine": "\"Really. Somehow I avoided fatal wounds.\""
    },
    {
      "lineNumber": 43973,
      "originalJapaneseLine": "「後方の指揮をこっちに押しつけて、前衛で……」",
      "translatedEnglishLine": "\"I pushed command in the rear to this side, and in the vanguard...\""
    },
    {
      "lineNumber": 43974,
      "originalJapaneseLine": "「適材適所の、つもりなんだけどね…………ん」",
      "translatedEnglishLine": "\"I intended proper placement of personnel... hmm.\""
    },
    {
      "lineNumber": 43975,
      "originalJapaneseLine": "気づけば、ウスピラの手が、",
      "translatedEnglishLine": "Before he noticed, Uspila’s hand"
    },
    {
      "lineNumber": 43976,
      "originalJapaneseLine": "サイアスの傷んだローブの端を掴んでいた。",
      "translatedEnglishLine": "had grabbed the edge of Saias’s torn robe."
    },
    {
      "lineNumber": 43977,
      "originalJapaneseLine": "「でも……少しくらい、心配してもいいでしょう？」",
      "translatedEnglishLine": "\"But... it’s okay to worry a little, right?\""
    },
    {
      "lineNumber": 43978,
      "originalJapaneseLine": "「ウスピラ……」",
      "translatedEnglishLine": "\"Uspila...\""
    },
    {
      "lineNumber": 43979,
      "originalJapaneseLine": "その手に、戦いの余熱を残すサイアスの手が",
      "translatedEnglishLine": "Saias’s hand, still warm from battle,"
    },
    {
      "lineNumber": 43980,
      "originalJapaneseLine": "音もなく被さった。",
      "translatedEnglishLine": "silently covered that hand."
    },
    {
      "lineNumber": 43981,
      "originalJapaneseLine": "「ああ…………まったく、辛い。辛すぎる」",
      "translatedEnglishLine": "\"Ah... truly painful. Too painful.\""
    },
    {
      "lineNumber": 43982,
      "originalJapaneseLine": "「サイアス？」",
      "translatedEnglishLine": "\"Saias?\""
    },
    {
      "lineNumber": 43983,
      "originalJapaneseLine": "「元気なら、このまま抱きしめるのに。",
      "translatedEnglishLine": "\"If you were well, I’d just hug you like this."
    },
    {
      "lineNumber": 43984,
      "originalJapaneseLine": "　今はキスの最中に、腹が鳴りそうだ」",
      "translatedEnglishLine": "But now, in the middle of a kiss, my stomach’s about to rumble.\""
    },
    {
      "lineNumber": 43985,
      "originalJapaneseLine": "「………………バカ」",
      "translatedEnglishLine": "\".........Idiot.\""
    },
    {
      "lineNumber": 43986,
      "originalJapaneseLine": "戦場は、徐々に遠ざかっていき。",
      "translatedEnglishLine": "The battlefield gradually faded away."
    },
    {
      "lineNumber": 43987,
      "originalJapaneseLine": "久しく聞こえてこなかった、",
      "translatedEnglishLine": "For a long time unheard,"
    },
    {
      "lineNumber": 43988,
      "originalJapaneseLine": "人間達の希望に満ちた鬨の声が、",
      "translatedEnglishLine": "the triumphant shouts of humans filled with hope"
    },
    {
      "lineNumber": 43989,
      "originalJapaneseLine": "ゼスの地に響き渡った。",
      "translatedEnglishLine": "echoed across the land of Zeth."
    },
    {
      "lineNumber": 43990,
      "originalJapaneseLine": "「倒したの、ガルティアを！？」",
      "translatedEnglishLine": "\"You defeated Galtia!?\""
    },
    {
      "lineNumber": 43991,
      "originalJapaneseLine": "その報を受けて、司令室内でも歓喜が爆発した。",
      "translatedEnglishLine": "Receiving that news, joy exploded inside the command room as well."
    },
    {
      "lineNumber": 43992,
      "originalJapaneseLine": "喜びの声と共に、大量の帽子が宙に舞う。",
      "translatedEnglishLine": "Along with cries of joy, a mass of hats flew into the air."
    },
    {
      "lineNumber": 43993,
      "originalJapaneseLine": "「ほ〜〜〜〜〜〜……っ！」",
      "translatedEnglishLine": "\"Hooooooo......!\""
    },
    {
      "lineNumber": 43994,
      "originalJapaneseLine": "長い長い溜息をついて、",
      "translatedEnglishLine": "Letting out a long, long sigh,"
    },
    {
      "lineNumber": 43995,
      "originalJapaneseLine": "マジックも席に身を沈める。",
      "translatedEnglishLine": "Magic also sank back into her seat."
    },
    {
      "lineNumber": 43996,
      "originalJapaneseLine": "「やってくれたわね。",
      "translatedEnglishLine": "\"They did it."
    },
    {
      "lineNumber": 43997,
      "originalJapaneseLine": "　これで……一歩前進だわ」",
      "translatedEnglishLine": "With this... we've taken one step forward.\""
    },
    {
      "lineNumber": 43998,
      "originalJapaneseLine": "「一歩だけ、だけどね。",
      "translatedEnglishLine": "\"Only one step, though."
    },
    {
      "lineNumber": 43999,
      "originalJapaneseLine": "　まだ、ゼスが滅ぼされてもお釣りが来るくらい、",
      "translatedEnglishLine": "There's still so much of the Demon Army left that Zeth could be destroyed and they'd still have plenty left."
    },
    {
      "lineNumber": 44000,
      "originalJapaneseLine": "　魔軍は残ってる」",
      "translatedEnglishLine": "The Demon Army remains.\""
    }
  ]
}

